import { useSelector } from 'react-redux';

const Notification = () => {
  const notification = useSelector(state => state.notification);
  // no functionality for which we'd dispatch an action yet

  const style = {
    border: 'solid',
    padding: 10,
    borderWidth: 1
  };

  return (
    <div style={style}>
      {notification}
    </div>
  );
}

export default Notification
